import React from 'react';
import { useNavigate } from 'react-router-dom';

export default function AdminDashboard() {
  const navigate = useNavigate();

  const handleLogout = () => {
    localStorage.removeItem('token'); // supprimer token
    navigate('/login');
  };

  return (
    <div style={{ padding: 20, maxWidth: 400, margin: 'auto', textAlign: 'center' }}>
      <h1>Dashboard Admin</h1>
      <p>Bienvenue sur la page admin.</p>

      <div style={{ margin: '20px 0' }}>
        <button onClick={() => navigate('/admin')} style={buttonStyle}>
          Dashboard Admin
        </button>
        <button onClick={() => navigate('/users')} style={buttonStyle}>
          Gestion Utilisateurs
        </button>
        <button onClick={() => navigate('/user')} style={buttonStyle}>
          Dashboard Utilisateur
        </button>
      </div>

      <button
        onClick={handleLogout}
        style={{ ...buttonStyle, backgroundColor: '#d9534f', color: 'white' }}
        onMouseOver={e => (e.currentTarget.style.backgroundColor = '#c9302c')}
        onMouseOut={e => (e.currentTarget.style.backgroundColor = '#d9534f')}
      >
        DÃ©connexion
      </button>
    </div>
  );
}

const buttonStyle = {
  display: 'block',
  width: '100%',
  padding: '10px',
  margin: '10px 0',
  fontSize: 16,
  borderRadius: 6,
  border: '1px solid #7f53ac',
  backgroundColor: 'white',
  color: '#7f53ac',
  cursor: 'pointer',
  fontWeight: 'bold',
};
